import React from 'react';
import {NavigationContainer} from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import Cadastro from './paginas/Cadastro';
import iniciar from './paginas/Iniciar';
import Login from './paginas/Login';



const Tab = createBottomTabNavigator();
const Stack = createStackNavigator(); 

function HomeScreen({ navigation }) {
  return (
    <TelaInicial navigation={navigation} />
  );
}

function HomeTabs() {
    return (
      <Tab.Navigator 
        screenOptions={{
          tabBarStyle: {
            backgroundColor: '#000000',
            borderTopColor: 'transparent',
          },
          tabBarActiveTintColor: '#643ee1',
          tabBarStyle: {
            paddingBottom: 5,
            paddingTop: 5
          }
        }}>
       <Tab.Screen
        name="Inicio" component={HomeScreen} 
        />

      </Tab.Navigator>
    )
        }
export default function Routes(){
    return(
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen 
          name='iniciar' 
          component={iniciar}
          options={{
            headerShown: false
          }}
          />
          <Stack.Screen
           name='Cadastro'
           component={Cadastro}
           options={{
            headerShown: false
          }}
          />
          <Stack.Screen
           name='Login'
           component={Login}
           options={{
            headerShown: false
          }}
          />
          <Stack.Screen
           name='TelaInicial'
           component={TelaInicial}
           options={{
            headerShown: false
          }}
          />
        <Stack.Screen
         name="Tabs" component={HomeTabs} options={{ headerShown: false }} />

        </Stack.Navigator>
      </NavigationContainer>
    )
}
